Plot Synopsis by Hal Erickson

Quand la Femme S'en Mele (When the Woman Butts In) stars French film favorite Edwige Feuillere as a high-class gangster's moll named Maine. When Maine's first husband and daughter pay a visit, it's an awkward time for our heroine and her current amour, gang boss Godot (Jean Servais). In addition to fielding a lot of embarrassing questions, Godot also has to deal with a pesky turf war with a rival mobster. Not that the ex-husband is a paragon of virtue: he's busy trying to get even with a crooked business associate. Billed fourth in the cast of Quand la Femme s'en Mele is Alain Delon, who, according to contemporary viewers, &quot;shows promise&quot;.

